import React, { Component } from "react";
import "../css/default.min.css";
import { Link, BrowserRouter as Router } from "react-router-dom";
import instagram  from './neon-space.jpg';


class Navbar extends Component {
  render() {
    return (
      <Router>
        <nav className="navigation">
          <ul>
            <li>
              <a href="/Mainpage">Not a member? Visit the DTE website.</a>
            </li>

            <li>
              <a href="https://www.instagram.com/ufdreamteam/?hl=en">
                <div class="logo-image">
                  ins &nbsp; &nbsp;
                  <img src="../img/ig_icon.png" />
                </div>
              </a>
            </li>
            <li>
              <a href="https://www.facebook.com/UFDreamTeam/">
                <div class="logo-image">
                &nbsp; &nbsp; fb 
                  <img src="../img/fbicon.png" />
                </div>
              </a>
            </li>
          </ul>
        </nav>
      </Router>
    );
  }
}

export default Navbar;
